import React, { Component } from 'react';
import axios from 'axios'
import { NativeSelect, InputLabel } from '@material-ui/core';

export default class Region extends Component {
    state = {
        prop: [],
        filtro: ''
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state
        const { filtro } = this.state


        return (
            <div>

                <InputLabel htmlFor="select">Filtrar por Categor√≠a</InputLabel>
                <NativeSelect id="select">
                    <option value={prop.map(item => {
                        if (item.region == 10) {
                            return (
                                <div key={item.id}>
                                    <h3>{item.tittle}
                                        <li>{item.region}</li>
                                        <li>{item.category}</li>
                                    </h3>
                                </div>
                            )
                        }

                    }
                    )}>Todo</option>
                    <option value="20">Venta</option>
                    <option value="20">Arriendo</option>
                </NativeSelect>


            </div>
        )
    }
}
